import React, { Component } from 'react'
import "./Join_Bts.css";
export default class Floating_button extends Component {
  render() {
    return (
      <div className="row-1">
        <div className="col-1">
          <button type='button' id='join'>Join Us</button>
        </div>
      </div>
    )
  }
}
